import React, { Component } from 'react';
import Panel from './panel';

class TodoList extends Component {
  render () {
    return (
    <Panel title="Todos">
      <ul className='App-todo'>
        {this.state.props.todos.map((todo) => {
          return (
            <li key={todo.id}>{todo.id}: {todo.title}</li>
          )
        })}
      </ul>
  </Panel>
  )
  }
}

export default TodoList;
